angular.module('starter.services', [])

.factory('Routes', function() {
  // Might use a resource here that returns a JSON array

  // Some fake testing data
  var routeItems = [
   {
   	id: 1,
   	title: 'Boerenlandroute',
   	description: 'Een rustige route langs rustieke bezienswaardigheden',
   	image: 'data:image/jpg;base64,'
   },
   {
   	id: 2,
   	title: 'Beekdalroute',
   	description: 'Ontdek de natuur van Genneper Parken',
   	image: 'data:image/jpg;base64,'
   },
   {
   	id: 3,
   	title: 'Cultuur-historische route',
   	description: 'Even terug in de tijd',
   	image: 'data:image/jpg;base64,'
   },
   {
   	id: 4,
   	title: 'Krachttrainingroute',
   	description: 'Trainen en fit worden',
   	image: 'data:image/png;base64,'
   }
  ];

  return {
    all: function() {
      return routeItems;
    },
    remove: function(routeItem) {
      routeItems.splice(routeItems.indexOf(routeItem), 1);
    },
    get: function(routeItemId) {
      for (var i = 0; i < routeItems.length; i++) {
        if (routeItems[i].id === parseInt(routeItemId)) {
          return routeItems[i];
        }
      }
      return null;
    }
  };
})

 .factory('Timer', function($interval) {
   var interval, incrementTimer;
   var start = 0,
     time = 0,
     actions = { start: "Start", stop: "Pause" },
     action = actions.start,
     connected = false,
     wasJustReset = true,
     socket = io.connect("http://safe-garden-3090.herokuapp.com:80");
   //var socket = io("http://192.168.0.103:3000");

   incrementTimer = function() {
     if(wasJustReset) {
       start = new Date().getTime();
       wasJustReset = false;
     }
     time = new Date().getTime() - start;
     socket.emit('time', time);
   };

   socket.on('connected', function(msg) {
     console.log("Connected");
     connected = true;
   });

   return {
     toggle: function() {
       if (action === actions.start) {
           action = actions.stop;
           start = new Date().getTime() - time;
           interval = $interval(incrementTimer, 50);

       } else if (action === actions.stop) {
           action = actions.start;
           $interval.cancel(interval);
       }
       return true;
     },
     reset: function() {
       action = actions.start;
       $interval.cancel(interval);
       time = 0;
       wasJustReset = true;
       return true;
     },
     getTime: function() {
       return time;
     },
     getAction: function() {
       return action;
     },
     getConnectionStatus: function() {
       return connected;
     }
   };
 });
